// src/componentes/elementos/Categorias.js
const Categorias = ({ onSeleccionar }) => {
  const categorias = [
    'Boxer sin costuras',
    'Boxer sin costura',
    'Boxer microfibra deportivo',
    'Boxer algodón premium',
    'Boxer mezcla stretch',
    'Boxer compresión ligera',
    'Boxer algodón clásico', // agregada si existe en tus productos
  ];

  return (
    <div className="catalogo-categorias">
      <nav className="navbar">
      <ul className="navbar-list">
        <li className="navbar-item"><Link to="/" className="navbar-link">Boxer sin costuras</Link></li>
        <li className="navbar-item"><Link to="/acerca" className="navbar-link">Boxer algodón</Link></li>
        <li className="navbar-item"><Link to="/contacto" className="navbar-link">Boxer microfibra deportivo</Link></li>
        <li className="navbar-item"><Link to="/catalogo" className="navbar-link">Boxer algodón premium</Link></li>
        <li className="navbar-item"><Link to="/Confeciones-creacion" className="navbar-link">Boxer mezcla stretch</Link></li>
        <li className="navbar-item"><Link to="/login" className="navbar-link">Boxer compresión ligera</Link></li>
        
      </ul>
    </nav>
    </div>
  );
};

export default Categorias;
